export const postDataToSheet = (selectedVideo) => {
    // const GSHEETS_API_KEY = process.env.REACT_APP_GOOGLESHEETS_API_KEY
    const GSHEETS_SHEET_ID = process.env.REACT_APP_QA_TEST_SHEET_1_ID
    const ACCESS_TOKEN = process.env.REACT_APP_ACCESS_TOKEN
    debugger   
    const rowId =  parseInt(selectedVideo.video.row)

    // const firstRow = 
    // const endRow = 
    debugger
    return (dispatch) => {
        fetch(`https://sheets.googleapis.com/v4/spreadsheets/${GSHEETS_SHEET_ID}/values/Sheet1!P${rowId}?valueInputOption=USER_ENTERED`,{
            method: 'PUT',
            headers:{
                "Content-Type": 'application/json',
                Authorization: `Bearer ${ACCESS_TOKEN}`
            },
                body: JSON.stringify({
                    "range": `Sheet1!P${rowId}` ,
                    "majorDimension": "COLUMNS",
                    "values": [
                        [selectedVideo.reviewer],
                    ]
                })
            }).then(response => response.json())
            .then(rxData => {
                debugger    
            if(rxData.error){
                alert(rxData.error.message)
            }else{

                console.log(rxData)
                dispatch({type: 'APPENDED_SHEET_DATA', sheetData: rxData})
            }
        })
    }

}   

